public class Solution {
    public int[] solution(int []arr) {
        int count = 0;
        for (int i=0;i<arr.length-1;i++) {
            if (arr[i] == arr[i+1]) {
                continue;
            } else {
                arr[count++] = arr[i];
            }
        }
        arr[count++] = arr[arr.length - 1];
        return Arrays.copyOfRange(arr, 0, count);
    }
}
